import React, { Component } from "react";

export class SearchResults extends Component {
  componentDidMount() {
    this.props.location.search = "hello";
  }
  render() {
    return (
      <div>
        <h1>hello</h1>
      </div>
    );
  }
}

export default SearchResults;
